function Secao(codparente, descricao, nivel){

    this.codparente = codparente;
    this.descricao = descricao;
    this.nivel = nivel;

    return {
        codparente: codparente,
        descricao: descricao,
        nivel: nivel,
    };

}

export default Secao;
